<!DOCTYPE html>
<html lang="ru">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Собери картинку</title>
  <style>
    body {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      height: 100vh;
      margin: 0;
      background: #f0f0f0;
      font-family: Arial, sans-serif;
    }
    #controls {
      margin-bottom: 15px;
    }
    #game {
      display: grid;
      gap: 2px;
      border: 4px solid #333;
      background: #333;
    }
    .piece {
      cursor: grab;
      transition: transform 0.2s;
    }
    .piece:active {
      transform: scale(1.05);
    }
    #message {
      margin-top: 15px;
      font-size: 18px;
      font-weight: bold;
      color: green;
    }
  </style>
</head>

    </select>
    <button id="shuffle">Перемешать</button>
  </div>
  <div id="game"></div>
  <div id="message"></div>

    let gridSize = 7;
    let pieceSize = 100;

    function initGame() {
      game.innerHTML = '';
      positions = [];
      gridSize = parseInt(sizeSelect.value);
      pieceSize = Math.floor(420 / gridSize);

      game.style.gridTemplateColumns = `repeat(${gridSize}, ${pieceSize}px)`;
      game.style.gridTemplateRows = `repeat(${gridSize}, ${pieceSize}px)`;

      for (let i = 0; i < gridSize * gridSize; i++) {
        const piece = document.createElement("div");
        piece.classList.add("piece");
        piece.style.width = pieceSize + "px";
        piece.style.height = pieceSize + "px";
        piece.style.backgroundImage = `url('${imageUrl}')`;
        piece.style.backgroundSize = `${pieceSize * gridSize}px ${pieceSize * gridSize}px`;

        let x = (i % gridSize) * -pieceSize;
        let y = Math.floor(i / gridSize) * -pieceSize;
        piece.style.backgroundPosition = `${x}px ${y}px`;

        piece.setAttribute("draggable", true);
        piece.dataset.index = i;
        positions.push(piece);
      }
      shufflePieces();
    }

    function shufflePieces() {
      positions.sort(() => Math.random() - 0.5);
      positions.forEach(p => game.appendChild(p));
      message.textContent = '';
    }

    function checkWin() {
      const current = [...game.children];
      for (let i = 0; i < current.length; i++) {
        if (parseInt(current[i].dataset.index) !== i) {
          return false;
        }
      }
      return true;
    }

    let dragged;

    game.addEventListener("dragstart", e => {
      if (e.target.classList.contains("piece")) {
        dragged = e.target;
      }
    });

    game.addEventListener("dragover", e => {
      e.preventDefault();
    });

    game.addEventListener("drop", e => {
      if (e.target.classList.contains("piece")) {
        let draggedIndex = [...game.children].indexOf(dragged);
        let targetIndex = [...game.children].indexOf(e.target);

        if (draggedIndex > -1 && targetIndex > -1) {
          game.insertBefore(dragged, e.target);
          game.insertBefore(e.target, game.children[draggedIndex]);
        }
        if (checkWin()) {
          message.textContent = "🎉 Пазл собран!";
        }
      }
    });

    shuffleBtn.addEventListener("click", shufflePieces);
    sizeSelect.addEventListener("change", initGame);

    initGame();
  </script>
